  // Sliding window with i jumping approach
  // "a b c a b c b b"
  //    | - first occurrence - we want i jump here
  //          | - second occurrence
  public static int lengthOfLongestSubstring(String s) {
    int n = s.length();
    int maxLength = 0;
    int i = 0;
    int j = 0;
    // use a Map keyed by Character (keyes are unigue to get i jump to the first occurrence of a
    // repeating char
    Map<Character, Integer> map = new HashMap<>();
    while (j < n) {
      // if the map contains the next character then move i to that first occurrence
      if (map.containsKey(s.charAt(j))) {
        i = Math.max(map.get(s.charAt(j)), i);
      }
      // (+ 1) to account for the edge case of a single char string
      maxLength = Math.max(maxLength, j - i + 1);
      // populate the map with unique chars one index ahead AND move (increment) j
      map.put(s.charAt(j), ++j);
    }
    return maxLength;
  }
